import React from "react";
import EmblaCarousel from "../Carousel/EmblaCarousel";

const CarouselPage = () => {
  return (
    <div className="Carousel">
      <EmblaCarousel slides={SLIDES} options={OPTIONS} />;
    </div>
  );
};

export default CarouselPage;
